    <p>{`Vector uses the Rust `}<a parentName="p" {...{
        "href": "https://github.com/daschl/grok"
      }}><inlineCode parentName="a">{`grok`}</inlineCode>{` library`}</a>{`. All patterns
`}<a parentName="p" {...{
