      "id": "debugging"
    }}>{`Debugging`}</h3>
    <p>{`We recommend the `}<a parentName="p" {...{
        "href": "https://grokdebug.herokuapp.com/"
      }}>{`Grok debugger`}</a>{` for Grok testing.`}</p>
