types.first_timestamp = "timestamp" # best effort parsing
types.second_timestamp = "timestamp|%Y-%m-%dT%H:%M:%S%z" # ISO8601
# ...
`}</code></pre>
    <p>{`As noted above, if you do not specify a specific `}<inlineCode parentName="p">{`strftime`}</inlineCode>{` format, Vector
